import React, { Component } from 'react';
import { NavLink as Link } from "react-router-dom";
import './navbar.css';

class Navbar extends Component {
    render() {
        return(
            <div className="navbarBG">
                <Link to="/about" className="links">
                    About
                </Link>
            </div>
        )
    }
};

export default Navbar;
